<!-- javascript code identical to imbraw2dng.js  for the classes IFDOut, TIFFOut, ZIPHelp, ImBCBase, ImBCBackw. -->
<script type="text/javascript" language="javascript">
"use strict;"
/* *************************************** IFDOut *************************************** */
/* Tiff IFD helper class */
class IFDOut {
/* Indentation out */
camprofptr = -1; // first of the pointers, they are sequential, accessed by TIFFOut
exifdataptr = -1; // the exif ifd, pointers therein must be adjusted
// rest is private:
#entrys = [];
#currentoff = 0;
// imgdata can be view or array
#imgdata = null;
#imglen = 0;
#imglen0 = 0;
#dyndata = [] ; //new Uint8Array(20000);
/* IFDOut: add image data to ifd */
addImageStrip(typ, view, width, height) {
	this.#imgdata = view;
	this.#imglen0 = view.byteLength ? this.#imgdata.byteLength : view.length;
	this.#imglen = (this.#imglen0 + 3) & 0xFFFFFFFC;
	this.addEntry(254 , 'LONG', [ typ ]); /* SubFileType */
	this.addEntry(256 , 'SHORT', [ width ]); /* width */
	this.addEntry(257 , 'SHORT', [ height ]); /* height */
	this.addEntry(273 , 'LONG', [ 0xFFFFFFFF ]); /* StipOffsets , special */
	this.addEntry(279 , 'LONG', [ this.#imglen0 ]); /* StripByte count */
	this.addEntry(278 , 'LONG', [ height ]); /* Rows per strip */
}
/* IFDOut: add entry to ifd */
addEntry(tag, type, value) {
	let x = TIFFOut.tToNum(type);
	let l = value.length;
	if (type === 'ASCII') l++;
	else if (type === 'RATIONAL' || type === 'SRATIONAL') l /= 2;
	if (tag === 273 || tag === 330 || tag === 34665) { /* special cases */
		let e = {
			tag: tag,
			type: x.t,
			count: l,
			ptr: value[0]
		};
		this.#entrys.push(e);
	} else if (l * x.l <= 4) { /* fits into data */
		let e = {

    for(var n =0; n < 256; n++){

        for(var k =0; k < 8; k++){
            c = ((c&1) ? (0xEDB88320 ^ (c >>> 1)) : (c >>> 1));

    }

	this.#lochdrs.push( { name: narr, dosdate: dosdate, crc: crc, dl: dl, fl: fl } );
	this.#loclens.push( 30+fl+dl );
	this.#writecb(lh, () => {
		this.#writecb(narr, () => {
			this.#writecb(data, () => { cb(); });
		})
	});
}
/* Indentation in - end of class ZIPHelp */
}

				// above stuff is now replaced taken from a dual-illuminant DCP profile

				ti.addEntry(50964, 'SRATIONAL', [ 7161, 10000, 10093, 100000, 14719, 100000, 25819, 100000, 72494, 100000, 16875, 1000000, 0, 1000000, 5178, 100000, 77342, 100000 ]); /* Forward Matrix 1 */

		if (this.withpreview && !this.neutral) {

		/* **** RAW image **** */
		ti.addImageStrip(0, view, w, h);

/* ImBCBase: wrapper for zip output */
writewrap(name, type, okmsg, arr1) {
	if (this.zip) {
		this.zip.add(arr1, name, () => {
			this.mappx(true, okmsg, name);
			if (this.zipdata && this.zipdata.length > ImBCHtml.zipmax) {
				this.zip.finish(() => {
					let o = new Uint8Array(this.zipdata.length);
					for (let p=0; p<this.zipdata.length; p++) o[p] = this.zipdata[p];
					this.writefile(this.appname + '_' + ('' + Date.now()).substring(3,10) + '_out.zip', 'application/zip', 'process.copyokcheckdl', o);
					this.zipdata = [];
					this.zip = new ZIPHelp((data, cb) => {
						for (let l=0; l<data.length; l++) this.zipdata.push(data[l]);
						cb();
						this.writepostok(name);
					});
				});
			}
			else this.writepostok(name);
		});
	} else
		this.writefile(name, type, okmsg, arr1);
}
/* ImBCBase: get white balance */
static getwb(view, typidx) {
	//console.log('GWB ' + typidx + ' ' + JSON.stringify(ImBCBase.infos[typidx]));
	const t = ImBCBase.infos[typidx];
	let r=1, g=1, b=1;
	for (let i=Math.round(0.05*t.h)*2; i<Math.ceil(0.9*t.h); i+=8) {
		for (let j=Math.round(0.05*t.w)*2; j<Math.ceil(0.9*t.w); j+=8) {
			let x = ImBCBase.getPix(j, i, t.w, view, t.typ);
			let lr = x[0];
			let lg = x[1] + 1;
			let lb = x[2];
			let p = Math.sqrt(lg*lg + lb*lb + lr*lr);
			if (p < 3 || p > (3*250)) continue;
			//if (((i*t.w + j) % 50000) < 10)
			//	console.log('i ' + i + ' j ' + j + ' R ' + lr + ' G ' + lg + ' B ' + lb + ' P ' + p);
			b += (lb)/(p);
			g += (lg)/(p);
			r += (lr)/(p);
		}
	}
	if ((r > b) && (r > g)) {
		return [ 10, 10, Math.ceil(300000*g/r), 300000, Math.ceil(300000*b/r), 300000 ];
	}
	else if ((b > r) && (b > g)) {
		return [ Math.ceil(300000*r/b), 300000, Math.ceil(300000*g/b), 300000, 10, 10 ];
	}
	else {
		return [ Math.ceil(300000*r/g), 300000, 10, 10, Math.ceil(300000*b/g), 300000 ];
	}
}
/* ImBCBase: get one downsampled median image value [ r g b ] */
static getPix(x, y, w, view, typ) {
	let outrgb = [];
	let reds = [];
	let w3 = w + (w>>1);
	let xx = x + (x>>1);
	if (typ === 5) {
		reds.push(((view.getUint8((y+0)*w3 + xx+0) +  ((view.getUint8((y+0)*w3 + xx+1) &0xF) << 8))-240)/16);
		reds.push(((view.getUint8((y+0)*w3 + xx+3) +  ((view.getUint8((y+0)*w3 + xx+4) &0xF) << 8))-240)/16);
		reds.push(((view.getUint8((y+2)*w3 + xx+0) +  ((view.getUint8((y+2)*w3 + xx+1) &0xF) << 8))-240)/16);
		reds.push(((view.getUint8((y+2)*w3 + xx+3) +  ((view.getUint8((y+2)*w3 + xx+4) &0xF) << 8))-240)/16);
	}
	else if (typ > 1) {
		reds.push(view.getUint8((y+1)*w + x + 1));
		reds.push(view.getUint8((y+1)*w + x + 3));
		reds.push(view.getUint8((y+1)*w + x + 2*w + 1));
		reds.push(view.getUint8((y+1)*w + x + 2*w + 3));
	} else {
		reds.push(view.getUint8(y*w + x + 1));
		reds.push(view.getUint8(y*w + x + 3));
		reds.push(view.getUint8(y*w + x + 2*w + 1));
		reds.push(view.getUint8(y*w + x + 2*w + 3));
	}
	reds.sort(function(a,b) { return a - b; });
	// median of red pixels
	outrgb.push((reds[1] + reds[2]) / 2.0);
	let greens = [];
	if (typ === 5) {
		greens.push((((view.getUint8((y+0)*w3 + xx+2)<<4) +  ((view.getUint8((y+0)*w3 + xx+1) &0xF0) >> 4))-240)/16);
		greens.push(((view.getUint8((y+1)*w3 + xx+0) +  ((view.getUint8((y+1)*w3 + xx+1) &0xF) << 8))-240)/16);
		greens.push((((view.getUint8((y+0)*w3 + xx+5)<<4) +  ((view.getUint8((y+0)*w3 + xx+4) &0xF0) >> 4))-240)/16);
		greens.push(((view.getUint8((y+1)*w3 + xx+3) +  ((view.getUint8((y+1)*w3 + xx+4) &0xF) << 8))-240)/16);
		greens.push((((view.getUint8((y+2)*w3 + xx+2)<<4) +  ((view.getUint8((y+2)*w3 + xx+1) &0xF0) >> 4))-240)/16);
		greens.push(((view.getUint8((y+3)*w3 + xx+0) +  ((view.getUint8((y+3)*w3 + xx+1) &0xF) << 8))-240)/16);
		greens.push((((view.getUint8((y+2)*w3 + xx+5)<<4) +  ((view.getUint8((y+2)*w3 + xx+4) &0xF0) >> 4))-240)/16);
		greens.push(((view.getUint8((y+3)*w3 + xx+3) +  ((view.getUint8((y+3)*w3 + xx+4) &0xF) << 8))-240)/16);
	}
	else if (typ > 1) {
		greens.push(view.getUint8(y*w + x + 1));
		greens.push(view.getUint8(y*w + x + w));
		greens.push(view.getUint8(y*w + x + 3));
		greens.push(view.getUint8(y*w + x + 2 + w));
		greens.push(view.getUint8(y*w + x + 2*w + 1));
		greens.push(view.getUint8(y*w + x + 3*w));
		greens.push(view.getUint8(y*w + x + 2*w + 3));
		greens.push(view.getUint8(y*w + x + 3*w + 2));
	} else {
		greens.push(view.getUint8(y*w + x));
		greens.push(view.getUint8(y*w + x + w + 1));
		greens.push(view.getUint8(y*w + x + 2));
		greens.push(view.getUint8(y*w + x + 3 + w));
		greens.push(view.getUint8(y*w + x + 2*w));
		greens.push(view.getUint8(y*w + x + 3*w +1));
		greens.push(view.getUint8(y*w + x + 2*w + 2));
		greens.push(view.getUint8(y*w + x + 3*w + 3));
	}
	greens.sort(function(a,b) { return a - b; });
	outrgb.push((greens[3] + greens[4]) / 2.0);
	let blues = [];
	if (typ == 5) {
		blues.push((((view.getUint8((y+1)*w3 + xx+2)<<4) +  ((view.getUint8((y+1)*w3 + xx+1) &0xF0) >> 4))-240)/16);
		blues.push((((view.getUint8((y+1)*w3 + xx+5)<<4) +  ((view.getUint8((y+1)*w3 + xx+4) &0xF0) >> 4))-240)/16);
		blues.push((((view.getUint8((y+3)*w3 + xx+2)<<4) +  ((view.getUint8((y+3)*w3 + xx+1) &0xF0) >> 4))-240)/16);
		blues.push((((view.getUint8((y+3)*w3 + xx+5)<<4) +  ((view.getUint8((y+3)*w3 + xx+4) &0xF0) >> 4))-240)/16);
	}
	else if (typ > 1) {
		blues.push(view.getUint8(y*w + x));
		blues.push(view.getUint8(y*w + x + 2));
		blues.push(view.getUint8(y*w + x + 2*w));
		blues.push(view.getUint8(y*w + x + 2*w + 2));
	} else {
		blues.push(view.getUint8((y+1)*w + x));
		blues.push(view.getUint8((y+1)*w + x + 2));
		blues.push(view.getUint8((y+1)*w + x + 2*w));
		blues.push(view.getUint8((y+1)*w + x + 2*w + 2));
	}
	blues.sort(function(a,b) { return a - b; });
	outrgb.push((blues[1] + blues[2]) / 2.0);
	return outrgb;
}
/* ImBCBase: build preview in array */
static buildpvarray(view, typ, w, h, orientation, scale, wb) {
	if (undefined === wb) wb = [ 6, 10, 1, 1, 6, 10 ];
	const sfact = scale ? scale : 8;
	const w8 = Math.floor((w+(sfact -1))/sfact);
	const h8 = Math.floor((h+(sfact -1))/sfact);
	const rfact = (wb[1]/wb[0]);
	const gfact = (wb[3]/wb[2]);
	const bfact = (wb[5]/wb[4]);
	let outpix = [];
	let rowiterstart, rowiterend;
	let coliterstart, coliterend;
	let transpose = false;
	if (orientation === 3) {
		rowiterstart = -1*(h8 -1);
		rowiterend = 1;
		coliterstart = -1*(w8 - 1);
		coliterend = 1;
	} else if (orientation === 6) {
		transpose = true;
		rowiterstart = 0;
		rowiterend = w8;
		coliterstart = -1*(h8 - 1);
		coliterend = 1;
	} else if (orientation === 8) {
		transpose = true;
		rowiterstart = -1*(w8 -1);
		rowiterend = 1;
		coliterstart = 0;
		coliterend = h8;
	} else {
		rowiterstart = 0;
		rowiterend = h8;
		coliterstart = 0;
		coliterend = w8;
	}
	let hist = new Array(256);
	for (let i = 0; i < 256; i++) hist[i] = 0;
	let cnt = 0;
	for (let i = rowiterstart; i < rowiterend; i +=1) {
		for (let j = coliterstart; j < coliterend; j+=1) {
			let a = ImBCBase.getPix(Math.abs(transpose ? i :j)*sfact, Math.abs(transpose ? j :i)*sfact, w, view, typ);
			outpix.push(a[0]);
			outpix.push(a[1]);
			outpix.push(a[2]);
			const v = Math.ceil((rfact*a[0] + gfact*a[1] + bfact*a[2])/3);
			if (v >= 255) hist[255]++;
			else hist[v]++;
			cnt++;
		}
	}
	// cut off top and bottom 7%
	let cntx = 0, allmin = 0, allmax = 255;
	while (cntx < (cnt * 0.07))
		cntx += hist[allmin++];
	allmin --;
	cntx = 0;
	while (cntx < (cnt * 0.07))
		cntx += hist[allmax--];
	allmax++;
	let fact;
	if (allmax > 247 && allmin < 8) fact = 1;
	/*else if (allmax - allmin < 33) {
		const d = ((255-33-allmin)/2)
		if (allmin < 255-33) {
			allmin += d;
			allmax += d;
		}
		fact = 8;
	}*/
	else fact = 240/(allmax - allmin);
	//console.log('ai ' + allmin + ' aa ' + allmax + ' ff ' + fact);
	const o = scale ? 3 : 4;
	const uic = new Uint8ClampedArray(h8 * w8 * o);
	for (let i = 0; i < h8; i++) {
		for (let j=0; j< w8; j++) {
			let nr = ((outpix[3*((i * w8) + j)] * rfact) - allmin) * fact + allmin;
			let ng = ((outpix[3*((i * w8) + j) + 1] * gfact) - allmin) * fact + allmin;
			let nb = ((outpix[3*((i * w8) + j) + 2] * bfact) - allmin) * fact + allmin;
			if (nr >= 255) {
				if (ng < 250) ng = Math.round(ng * 255 / nr);
				if (nb < 250) nb = Math.round(nb * 255 / nr);
				nr = 255;
			}
			else if (nr <= 0) nr = 0;
			if (ng >= 255) {
				if (nr < 250) nr = Math.round(nr * 255 / ng);
				if (nr >= 255) nr = 255;
				if (nb < 250) nb = Math.round(nb * 255 / ng);
				ng = 255;
			}
			else if (ng <= 0) ng = 0;
			if (nb >= 255) {
				if (ng < 250) ng = Math.round(ng * 255 / nb);
				if (ng >= 255) ng = 255;
				if (nr < 250) nr = Math.round(nr * 255 / nb);
				if (nr >= 255) nr = 255;
				nb = 255;
			}
			else if (nb <= 0) nb = 0;
			// maybe some brightening gamma?
			uic[o * ((i*w8) + j)] = 255-Math.round(255*((255-nr)/255)*((255-nr)/255));
			uic[o * ((i*w8) + j) + 1] = 255-Math.round(255*((255-ng)/255)*((255-ng)/255));
			uic[o * ((i*w8) + j) + 2] = 255-Math.round(255*((255-nb)/255)*((255-nb)/255));
			if (!scale) uic[o * ((i*w8) + j) + 3] = 255;
		}
	}
	return uic;
}
/* ImBCBase: handle one entry from imb PHOTO/MOVIE listing page */
handle1imb(url, time) {
	let rawname = ImBCBase.basename(url);
	if (rawname.substring(0,10).toUpperCase() === 'IMBRAW2DNG') return;
	if (rawname.substring(0,6).toUpperCase() === 'IMBAPP') return;
	let timestx = ImBCBase.fnregex.exec(rawname);
	let timesty = time ? ImBCBase.itsregex.exec(time) : null;
	let timest = null, cl = '9999_99_99-99';
	if (this.mingrp === 'd') cl = '9999_99_99';
	if (null !== timestx) {
		timest = timestx[1] + '_' + timestx[3] + '_' + timestx[5] + '-' + timestx[7] + '_' + timestx[9] + '_' + timestx[11];
		cl = timestx[1] + '_' + timestx[3] + '_' + timestx[5] + (this.mingrp === 'h'? ('-' + timestx[7]) : '');
	} else {
		this.mappx(false, 'words.warning');
		this.mappx(true, 'onimback.strangename', rawname);
	}
	if (null !== timesty) {
		timest = timesty[1] + '_' + timesty[3] + '_' + timesty[5] + '-' + timesty[7] + '_' + timesty[9] + '_' + timesty[11];
	}
	if (rawname.substring(rawname.length -4).toUpperCase() === '.RAW') {
		if (null !== timest) {
			if (timest < this.earliestraw) this.earliestraw = timest;
			if (timest > this.latestraw) this.latestraw = timest;
		}
		this.rimbpics.push({ url: url, time: timest });
		if (this.imbeles && this.typedclasses) {
			this.imbeles.push({
					type: 'RAW',
					url: url,
					raw: rawname,
					ts: cl,
					selected: false,
					preview: null,
					entry: null,
					waiting: false,
					error: false,
					processed: false,
					time: timest
			});
			if (this.untypedclasses.findIndex(v => v === cl) === -1)
				this.untypedclasses.push(cl);
			if (this.typedclasses.findIndex(v => v === ('RAW' + cl)) === -1)
				this.typedclasses.push('RAW' + cl);
		}
	}
	else if (rawname.substring(rawname.length -4).toUpperCase() === '.JPG') {
		if (null !== timest) {
			if (timest < this.earliestjpg) this.earliestjpg = timest;
			if (timest > this.latestjpg) this.latestjpg = timest;
		}
		this.imbpics.push({ url: url, time: timest });
		if (this.imbeles && this.typedclasses) {
			this.imbeles.push({
					type: 'JPG',
					url: url,
					raw: rawname,
					ts: cl,
					selected: false,
					preview: null,
					entry: null,
					waiting: false,
					error: false,
					processed: false,
					time: timest
			});
			if (this.untypedclasses.findIndex(v => v === cl) === -1)
				this.untypedclasses.push(cl);
			if (this.typedclasses.findIndex(v => v === ('JPG' + cl)) === -1)
				this.typedclasses.push('JPG' + cl);
		}
	}
	else if (rawname.substring(rawname.length -4).toUpperCase() === '.MP4') {
		if (null !== timest) {
			if (timest < this.earliestmov) this.earliestmov = timest;
			if (timest > this.latestmov) this.latestmov = timest;
		}
		this.imbmovies.push({ url: url, time: timest });
		if (this.imbeles && this.typedclasses) {
			this.imbeles.push({
					type: 'oth',
					url: url,
					raw: rawname,
					ts: cl,
					selected: false,
					preview: null,
					entry: null,
					waiting: false,
					error: false,
					processed: false,
					time: timest
			});
			if (this.untypedclasses.findIndex(v => v === cl) === -1)
				this.untypedclasses.push(cl);
			if (this.typedclasses.findIndex(v => v === ('oth' + cl)) === -1)
				this.typedclasses.push('oth' + cl);
		}
	}
	else {
		this.appmsgxl(false, 'words.warning');
		this.appmsgxl(0, 'onimback.strangename', rawname);
	}
}

/* ImBCHtmlOut: find html style for translation */
applystyle(span, msg, base) {
	if (undefined === base) base = ImBCBase.texts;
	const i = msg.indexOf('.');
	if (i === -1) {
		let r = base[msg]['htmlstyle'];
		if (r !== undefined) {
			for (const s of r) {
				span.style[s[0]] = s[1];
			}
		}
		return span;
	}
	else {
		const e = base[msg.substring(0,i)];
		return this.applystyle(span, msg.substring(i+1), e);
	}
}

/* ImBCHtmlOut: wrapper for zip output */
starthandleone() {
	if (!this.imbcb && window.showSaveFilePicker && document.getElementById('usezip').checked) {
		// zip with selected file
		window.showSaveFilePicker({
			types: [ { description: 'Output Zip Archive', accept: { "application/zip": [ ".zip", ".ZIP" ] } } ],
			startIn: 'downloads',
			suggestedName: this.appname + '_' + ('' + Date.now()).substring(3,10) + '_out.zip'
		}).then((newHandle) => {
			newHandle.getFile().then((f) => {
				this.zipname = f.name;
				newHandle.createWritable().then((ws) => {
					this.writestream = ws;
					this.zip = new ZIPHelp((data, cb) => {
						let p = this.writestream.write(data);
						p.then(() => { cb(); }).catch((e) => {
							this.mappx(false, 'words.error');
							this.mappx(0, 'process.errsave', this.zipname);
							this.appmsg(JSON.stringify(e), true);
							this.ziperr = true;
							cb();
						});
					});
					this.handleonex();
				}).catch((e) => {
					this.mappx(false, 'words.error');
					this.mappx(0, 'process.errsave', this.zipname);
					this.appmsg(JSON.stringify(e), true);
					this.afterfinish();
				});
			}).catch((e) => {
				this.mappx(false, 'words.error');
				this.mappx(0, 'process.errsave', '??');
				this.appmsg(JSON.stringify(e), true);
				this.afterfinish();
			});
		}).catch((e) => {
				this.mappx(false, 'words.error');
				this.mappx(0, 'process.errsave', '??');
				this.appmsg(JSON.stringify(e), true);
				this.afterfinish();
			});
	}
	else if (this.totnum > 1 && !this.imbcb && document.getElementById('usezip').checked) {
		// zip via normal download
		this.writestream = null;
		this.zipdata = [];
		this.zip = new ZIPHelp((data, cb) => {
			for (let l=0; l<data.length; l++) this.zipdata.push(data[l]);
			cb();
		});
		this.handleonex();
	}
	else this.handleonex();
}
/* ImBCHtmlOut: main handler function for one file */
handleonex() {
	const f = (this.debugflag && this.useraw) ? this.useraw : this.allfiles[this.actnum];
	this.currentrot = (f.rot || (f.rot === 0)) ? f.rot : 1;
	document.getElementById('doforall').checked = false;
	if (this.actnum < this.totnum-1) {
		document.getElementById('forrest').style['display'] = '';
	} else document.getElementById('forrest').style['display'] = 'none';
	let rawname = ImBCBase.basename(f.url ? f.url : (f.name ? f.name : f));
	if (this.stepmode === 2) {
		// skip rest
		if (!this.imbcb) this.shownormal();
		return this.handlenext();
	}
	else if (this.stepmode === 1) {
		// show preview and ask for rotation, skip, save
		// then (in handler) set mode, call handleone (if save) or handlenext (if skip)
		if (!this.imbcb) this.showquestion();
		if (undefined === f) {
			return;
		}
		if (this.totnum > 1) {
			document.getElementById('qhdr').innerHTML = '[' + (1 + this.actnum) + ' / ' + this.totnum + '] ';
		} else document.getElementById('qhdr').innerHTML = '';
		if (rawname.substring(rawname.length -4).toUpperCase() === '.JPG' ||
			rawname.substring(rawname.length -5).toUpperCase() === '.JPEG') {
			/* jpeg preview */
			this.#qappx('main.file.jpeg', rawname);
			if (f.name) {
				// read jpeg file for preview
				const fr = new FileReader();
				fr.onload = (evt) => {
					let contents = evt.target.result;
					contents = 'data:image/jpeg;' + contents.substring(8);
					document.getElementById('jpegpreview').src = contents;
					/* shown in onload of img */
				}
				fr.onerror = (evt) => {
					console.log('JPEG preview reader error for ' + f.name + ' ' + JSON.stringify(evt));
					this.setpverr();
				}
				fr.readAsDataURL(f);
			}
			else {
				// simply set image src
				document.getElementById('jpegpreview').src = ImBCHtml.adjurl(f)+'?custom=1&cmd=4001';
			}
		}
		else if (rawname.substring(rawname.length -4).toUpperCase() === '.MP4') {
			// simply set image src
			document.getElementById('jpegpreview').src = ImBCHtml.adjurl(f)+'?custom=1&cmd=4001';
			this.#qappx('main.file', rawname);
		}
		else if (rawname.substring(rawname.length -4).toUpperCase() !== '.RAW') {
			/* no preview */
			this.#qappx('main.file.nopreview', rawname);
			this.setnopv();
		}
		else {
			const zz = ImBCBase.infos.findIndex(v => v.size === f.size);
			if (zz === -1 && undefined !== f.size) {
				/* no preview */
				this.#qappx('main.file.rawunknown', rawname, f.size);
				this.setnopv();
			} else {
				this.#qappx('main.file',rawname);
				this.buildpreview(f, () => { this.setrawpv(); }, () => { this.setpverr(); });
			}
		}
	}
	else { // normal processing without question
		if (this.imbcb)
			this.imbcb.handleone();
		else {
			this.shownormal();
			this.handleone(f.rot);
		}
	}
}
/* ImBCHtmlOut: translation helper */

/* ImBCHtmlOut: handle the normal selection from imback (do it button), also for nodejs */
imbdoit() {
	if (this.actnum !== this.allfiles.length) return;
	let selecteds = [];
	let compval = '0000';
	if (document.getElementById('imbstartts').value != undefined && document.getElementById('imbstartts').value.length > 0) {
		compval = document.getElementById('imbstartts').value;
		if (null === ImBCBase.tsregex.exec(compval)) {
			this.mappx(false, 'words.error');
			this.mappx(0, 'onimback.invaltime', compval);
			alert(this.rmesc(this.xl('onimback.invaltime'), compval));
			return;
		}
	}
	if (document.getElementById('rpicfromimb').checked) {
		for (const e of this.rimbpics) {
			let rawname = ImBCBase.basename(e.url);
			if (this.comptime(rawname, compval))
				selecteds.push(e);
		}
	}
	if (document.getElementById('picfromimb').checked) {
		for (const e of this.imbpics) {
			let rawname = ImBCBase.basename(e.url);
			if (this.comptime(rawname, compval))
				selecteds.push(e);
		}
	}
	if (document.getElementById('movfromimb').checked) {
		for (const e of this.imbmovies) {
			let rawname = ImBCBase.basename(e.url);
			if (this.comptime(rawname, compval))
				selecteds.push(e);
		}
	}
	selecteds.sort((a, b) => {
		let ra = ImBCBase.basename(a.url ? a.url :a);
		let rb = ImBCBase.basename(b.url ? b.url :b);
		if (ra < rb) return -1;
		else if (ra === rb) return 0;
		else return 1;
	});
	this.checkchecks();
	this.totnum = selecteds.length;
	this.stats = { total: this.totnum, skipped: 0, error: 0, ok: 0 };
	this.actnum = 0;
	this.allfiles = selecteds;
	this.mappx(true, 'process.frombackn', this.totnum);
	if (this.totnum > 0) {
		document.getElementById('imbdoit').disabled = true;
		document.getElementById('imbvisbrows').disabled = true;
		document.getElementById('droptarget').style['display'] = 'none';
		document.getElementById('infile').disabled = true
		this.starthandleone();
	}
	else this.mappx(true, 'onimback.nomatch');
}

/* ImBCHtmlOut: nodejs: parse config */
parseconfig(data) {
	const d = JSON.parse(data);
	if (d.np) this.withpreview = false;
	else this.withpreview = true;
	if (undefined !== d.cr) this.copyright = d.cr;
	if (d.l) this.trylang(d.l);
	if (d.ndcp) this.incdcp = false; else this.incdcp = true;
	if (d.owb) this.constwb = true; else this.constwb = false;

		ll.scrollIntoView(false, { block: 'nearest' });
	}

/* ImBCHtmlOut: post write ok handler */
writepostok(name) {
	const ie = this.imbeles.find((v) => v.raw.substring(0, v.raw.length - 3) === name.substring(0, name.length - 3));
	if (ie) {
		ie.wasselected = true;
		if (ie.entry)
			ie.entry.classList.add('picprocd');
	}
	this.stats.ok++;
	this.handlenext();
}
/* ImBCHtmlOut: after finishing.... */
afterfinish() {
	if (this.zip) {
		this.zip.finish(() => {
			if (this.writestream) {
				this.writestream.close().then(() => {
					if (!this.ziperr) {
						this.mappx(false, 'words.finished');
						this.mappx(true, 'process.copyok', this.zipname);
					} else {
						this.mappx(false, 'words.error');
						this.mappx(true, 'process.errsave', this.zipname);
					}
				}).catch((e) => {
					this.mappx(false, 'words.error');
					this.mappx(0, 'process.errsave', this.zipname);
					this.appmsg(JSON.stringify(e), true);
				});
			} else if (this.zipdata) {
				let o = new Uint8Array(this.zipdata.length);
				for (let p=0; p<this.zipdata.length; p++) o[p] = this.zipdata[p];
				this.writefile(this.appname + '_' + ('' + Date.now()).substring(3,10) + '_out.zip', 'application/zip', 'process.copyokcheckdl', o);
			}
		});
		this.zip = null;
		this.zipdata = null;
		this.ziperr = false;
	}
	if (this.stats.total > 0) {
		this.appmsg('');
		this.mappx(true, 'process.totals', this.stats.total, this.stats.ok, this.stats.skipped, this.stats.error);
	}
	this.actnum = 0;
	this.totum = 0;
	this.allfiles = [];
	if (this.fromvisbrows) {
		this.fromvisbrows = false;
		document.getElementById('progmsg').style['display'] = '';
		document.getElementById('progokbut').disabled = false;
		document.getElementById('progmsg').innerHTML = this.xl('process.totals', this.stats.total, this.stats.ok, 0, this.stats.error);
		this.loadnextimg();
	}
	document.getElementById('imbdoit').disabled = false;
	document.getElementById('imbvisbrows').disabled = false;
	document.getElementById('droptarget').style['display'] = '';
	document.getElementById('infile').disabled = false;
	if (document.getElementById('infileb')) document.getElementById('infileb').disabled = false;
}
/* ImBCHtmlOut: look at the checkboxes and set settings */
checkchecks() {
    this.stepmode = 0;
	const stepprev = document.getElementById('steppreview');
	if (stepprev !== null && stepprev.checked) this.stepmode = 1;
	const copytext = document.getElementById('copytext');

/* ImBCHtml: visual browser: build ordered lists */
buildtree() {
	let list, toplevel;

	}
	else {
		list = this.untypedclasses;
	}

	// first, make everything empty
	for (const e of this.untypedclasses) {

		this.#doclose(e, true);
	}
	for (const e of this.typedclasses) {
		e.entry.remove();
		this.#doclose(e, true);
	}
	for (const d of this.imbeles) {
		if (undefined !== d.entry && null !== d.entry && d.entry.remove)

	}

	//for (const e of list.filter((o) => o.level === toplevel).sort((a,b) => this.#mysort(a, b))) {
	for (const e of list.sort((a,b) => this.#mysort(a, b))) {

/* ImBCHtml: visual browser: find next to load */
/* four phases, finding a match for one skips all following phases */
/* 0: visible JPG+MP4 */
/* 1: visible RAW */
/* 2: invisible JPG+MP4 */
/* 3: invisible RAW */
#findnexttoload() {
	let res = undefined, ph = 4;
	for (const e of this.imbeles.sort((a,b) => this.#myisort(a,b))) {
		if (!e.entry) continue;
		const p = e.entry;
		if (!p.parentElement) continue;
		// not waiting or error at all?
		if (e.nonewerr) continue;
		if (p.attributes.getNamedItem('data-state').value !== 'err' && p.attributes.getNamedItem('data-state').value !== 'wait') continue;
		let dispno = false;
		let f = p.parentElement;
		while (f) {
			if (f.style['display'] === 'none') {
				dispno = true;
				if (e.type !== 'RAW' && ph >= 3) {
					res = e;
					ph = 2;
				}
				else if (ph >= 4) {
					res = e;
					ph = 3;
				}
				break;
			}
			if (f.classList.contains('ggclosed')) {
				dispno = true;
				if (e.type !== 'RAW' && ph >= 3) {
					res = e;
					ph = 2;
				}
				else if (ph >= 4) {
					res = e;
					ph = 3;
				}
				break;
			}
			f = f.parentElement;
		}
		if (dispno) continue;
		// display not none, check pos
		let rect = p.getBoundingClientRect();
		if (rect.top < window.innerHeight && rect.bottom > 0 && rect.width > 0) {
			// visible
			if (e.type !== 'RAW' && ph >= 1) {
				res = e;
				ph = 0;
				break;
			}
			else if (ph >= 2) {
				res = e;
				ph = 1;
			}
		}
		else if (e.type !== 'RAW' && ph >= 3) {
			res = e;
			ph = 2;
		}
		else if (ph >= 4) {
			res = e;
			ph = 3;
		}
	}
	return res;
}
/* ImBCHtml: visual browser: sort helper */
#mysort(a, b) {
	let at = a.title, bt = b.title;
	const fact = document.getElementById('solder').checked ? 1 : -1
	if (a.title.startsWith('oth') && !b.title.startsWith('oth')) return -1;		// oR oJ
	else if (b.title.startsWith('oth') && !a.title.startsWith('oth')) return 1;	// Ro Jo
	else if (a.title.startsWith('JPG') && b.title.startsWith('RAW')) return 1;	// (Jo) JR
	else if (b.title.startsWith('JPG') && !a.title.startsWith('JPG')) return -1;	// (oJ) RJ
	else if (a.title.startsWith('JPG') || a.title.startsWith('RAW') || a.title.startsWith('oth')) {
		at = a.title.substring(3);
		bt = b.title.substring(3);
	}
	if (at > bt) return fact;
	else if (at < bt) return -1 * fact;
	else return 0;
}
/* ImBCHtml: visual browser: sort helper */
#myisort(a, b) {
	const fact = document.getElementById('solder').checked ? 1 : -1
	if (a.raw > b.raw) return fact;
	else if (a.raw < b.raw) return -1 * fact;
	else return 0;
}
/* ImBCHtml: visual browser: add images sorted  */
#addimgsorted(el) {
	if (el.fmembers !== null && el.fmembers !== undefined) {
		for (const e of el.fmembers.sort((a,b) => this.#myisort(a, b))) {
			if (null === e.entry || undefined === e.entry) this.#displaydiv(e);
			el.entry.querySelector('.igtype').append(e.entry);
			e.nonewerr = false; // retry again if was error
		}
	}
}
/* ImBCHtml: visual browser: add sorted recursively */
#addsorted(el) {
	if (el.smembers === null || el.smembers ===  undefined) return;
	for (const e of el.smembers.sort((a,b) => this.#mysort(a, b))) {

		el.entry.append(e.entry);

}

/* ImBCHtml: visual browser: recursive fold close */
#doclose(gr, recurse) {

	e.querySelector('.ggtt').classList.remove('ggttopen');
	e.classList.add('ggclosed');
	e.classList.remove('ggopen');
	if (recurse && gr.smembers)
		for (const m of gr.smembers) this.#doclose(m, recurse);
}
/* ImBCHtml: visual browser: recursive fold open */
#doopen(gr, recurse, nontop) {
	const e = gr.entry;
	e.querySelector('.ggtt').classList.remove('ggttclosed');
	e.querySelector('.ggtt').classList.add('ggttopen');
	e.classList.remove('ggclosed');
	e.classList.add('ggopen');
	if (recurse && gr.smembers)
		for (const m of gr.smembers) this.#doopen(m, recurse, true);
	if (gr.fmembers) {
		for (const m of gr.fmembers) {
			if (m.entry?.remove) m.entry.remove();

/* ImBCHtml: visual browser: add classes upwards */
#higherclasses(arr, len, curlevel) {
	for (const u of arr.filter((o) => o.level === curlevel)) {
		if (u.ischild) continue;
		if (arr.filter((o) => u.title.substring(0,len) === o.title.substring(0,len)).length === 1) {
			u.level --;
			u.title = u.title.substring(0,len);
			u.entry.classList.add('gl' + u.level);
			u.entry.classList.remove('gl' + (u.level + 1));
		} else if (arr.findIndex((o) => o.title === u.title.substring(0,len)) === -1) {
			const cl = {
				title: u.title.substring(0,len),
				level: curlevel - 1,
				smembers: []
			};
			cl.entry = document.createElement('div');
			const ce = cl.entry;
			ce.id = 'gg_' + u.title.substring(0,len) + '_X';
			ce.classList.add('gg');
			ce.classList.add('ggclosed');
			ce.classList.add('gl' + (curlevel - 1));
			for (const x of arr.filter((o) => u.title.substring(0,len) === o.title.substring(0,len))) {
				x.ischild = true;
				// todo: sort when open
				cl.smembers.push(x);
				cl.haschildren = true;
				arr.splice(arr.findIndex((o) => o.title === x.title),1);
			}
			arr.push(cl);
		}
	}
	// 5	h	y => again ->
	// 4	h  	y => again
	// 5	h	m => again 1x
	// 5    d   y => again 1x
	// 5    d   m ready
	// (5	d	d	 not called at all)
	if (curlevel === 5 && ((this.maxgrp === 'y') || ((this.mingrp === 'h')) && (this.maxgrp === 'm')))
		this.#higherclasses(arr, len - 3, 4);
	else if (curlevel === 4 && (this.maxgrp === 'y') && (this.mingrp === 'h'))
		this.#higherclasses(arr, len - 3, 3);
}
/* visual browser: return count of files in class */
#countfiles(cla) {
	let res = 0;
	if (undefined !== cla.fmembers) res += cla.fmembers.length;
	if (undefined !== cla.smembers)
		for (const s of cla.smembers)
			res += this.#countfiles(s);
	return res;
}
/* ImBCHtml: visual browser: recursive count selection */
#countsel(gr) {
	let res = 0;
	if (gr.fmembers) {
		res += gr.fmembers.filter((o) => o.selected).length;
	}
	if (gr.smembers) {
		for (const g of gr.smembers)
			res += this.#countsel(g);
	}
	gr.entry.querySelector('.selnumber').innerHTML = '' + res;
	gr.entry.querySelector('.selcb').checked = (res === this.#countfiles(gr));
	gr.sels = res;
	return res;
}
/* ImBCHtml: visual browser: update all "selected" values */
#updateselections() {
	for (const s of this.typedclasses) this.#countsel(s);
	for (const s of this.untypedclasses) this.#countsel(s);
	let res = 0, sum = 0;
	for (const s of this.typedclasses) {
		res += s.sels;
		sum += this.#countfiles(s);
	}
	document.getElementById('brnsel').innerHTML = '' + res;
	document.getElementById('selall').checked = (res === sum);
	document.getElementById('delselbut').disabled = (res === 0);
	document.getElementById('doselbut').disabled = (res === 0);
}

/* ImBCHtml: visual browser: image loader call */
#loadimg(url, type, to/*, rot*/) {
	const e = to.entry;
	if ((e.attributes.getNamedItem('data-state').value !== 'err' && e.attributes.getNamedItem('data-state').value !== 'wait')) {
		if (this.debugflag) console.log('ldr aa lnx ' + to.raw);
		this.loadnextimg();
		return;
	}
	e.setAttribute('data-state', 'load');
	e.querySelector('.eepvx').style['display'] = 'none';
	e.querySelector('.errimg').style['display'] = 'none';
	e.querySelector('.waitdiv').style['display'] = '';
	to.preview.style['display'] = 'none';
	if (type !== 'RAW') {
		to.preview.onload = (/*ev*/) => {
			e.setAttribute('data-state', 'ok');
			e.querySelector('.waitdiv').style['display'] = 'none';
			to.preview.style['display'] = '';
			//to.preview.style['height'] = to.preview.height * (163 / to.preview.width);
			e.querySelectorAll('.biggiebtn').forEach((x) => { x.classList.remove('disabled') });
			e.querySelector('.dlbtn').classList.remove('disabled');
			if (this.debugflag) console.log('ldr j f lnx ' + to.raw);
			this.loadnextimg();
		};
		to.preview.onerror = (ev) => {
			e.setAttribute('data-state', 'err');
			console.log('JPEG preview load error for ' + url + ' ' + JSON.stringify(ev));
			e.querySelector('.waitdiv').style['display'] = 'none';
			e.querySelector('.errimg').style['display'] = '';
			e.querySelectorAll('.biggiebtn').forEach((x) => { x.classList.add('disabled') });
			e.querySelector('.dlbtn').classList.add('disabled');
			if (this.debugflag) console.log('ldr j e lnx ' + to.raw);
			to.nonewerr = true;
			this.loadnextimg();
		};
		to.preview.src = ImBCBase.adjurl(url) + '?custom=1&cmd=4001';
	}
	else {
		let afterloadcalled = false;
		if (this.debugflag) console.log('li raw start bpv ' + url);
		this.buildpreview((this.debugflag && this.useraw) ? this.useraw : url, () => { /* on ok: */
			e.setAttribute('data-state', 'ok');
			e.querySelector('.waitdiv').style['display'] = 'none';
			e.querySelectorAll('.biggiebtn').forEach((x) => { x.classList.remove('disabled') });
			e.querySelector('.dlbtn').classList.remove('disabled');
			to.preview.style['display'] = '';
			if (this.debugflag) console.log('ldr r f ' + to.raw);
			if (!afterloadcalled) {
				if (this.debugflag) console.log('ldr r e lnx ' + to.raw);
				this.loadnextimg();
			} // else the afterload had already been called
			else if (this.debugflag) {
				console.log('ldr r ff lnyy ' + to.raw);
			}
		}, () => { /* on err: */
			e.setAttribute('data-state', 'err');
			e.querySelector('.waitdiv').style['display'] = 'none';
			e.querySelector('.errimg').style['display'] = '';
			e.querySelectorAll('.biggiebtn').forEach((x) => { x.classList.add('disabled') });
			e.querySelector('.dlbtn').classList.add['disabled'];
			to.nonewerr = true;
			if (this.debugflag) console.log('ldr r e ' + to.raw);
			if (!afterloadcalled) {
				if (this.debugflag) console.log('ldr r e lnx ' + to.raw);
				this.loadnextimg();
			} // else the afterload had already been called
			else if (this.debugflag) {
				console.log('ldr r ee lnyy ' + to.raw);
			}
		}, to.rot, to.preview, () => { /* afterload: */
			if (this.debugflag) console.log('ldr r l lnx ' + to.raw);
			// invalidate url for err callback
			this.#loaderrunning = '1';
			this.loadnextimg();
			afterloadcalled = true;
		});
		if (this.debugflag) console.log('li raw end bpv ' + url);
	}
}

/* ImBCHtml: visual browser: do delete */
dodelete(list, status) {
	if (list === undefined && this.imbeles.filter((o) => o.selected).length === 0) {
		this.delcancel();
		return;
	}
	else if (list === undefined && this.#rotphase !== -1) {
		document.getElementById('delokbut').disabled = true;
		document.getElementById('delcancelbut').disabled = true;
		this.dodelete(this.imbeles.filter((o) => o.selected), { no: this.imbeles.filter((o) => o.selected).length, ok: 0, err: 0 });
		this.#rotphase=0;
		document.getElementById('delprogmsg').innerHTML = this.rotphases[this.#rotphase];
		return;
	} else if (list === undefined) {
		this.delcancel();
		this.#rotphase = 0;
		document.getElementById('delprogmsg').innerHTML = '';
	} else if (list.length > 0) {
		this.custcmd(4003, 'document', 'str=' + list[0].url, (res) => {
			this.#rotphase ++;
			document.getElementById('delprogmsg').innerHTML = this.rotphases[this.#rotphase % this.rotphases.length];
			if (0 <= res) {
				status.ok++;
				list[0].selected = false;
				if (list[0].entry) list[0].entry.querySelector('.selcb').checked = false;
				const pv = list[0].preview;
				if (pv)
					pv.classList.add('picdeleted');
				if (pv?.parentElement)
					pv.parentElement.classList.add('picdeleted');
				this.#updateselections();
			} else {
				status.err++;
			}
			list.splice(0,1);
			this.dodelete(list, status);
		});
	} else {
		document.getElementById('delprogmsg').innerHTML = this.xl('process.totals', status.no, status.ok, 0, status.err);
		document.getElementById('delokbut').disabled = false;
		document.getElementById('delcancelbut').disabled = false;
		this.#rotphase = -1;
	}
}

/* ImBCHtml: visual browser: process browser selected */
browserprocess() {
	if (this.actnum !== this.allfiles.length) return;
	let selecteds = [];
	for (const i of this.imbeles) {
		if (i.selected) {
			selecteds.push(i);
		}
	}
	selecteds.sort((a, b) => {
		let ra = ImBCBase.basename(a.url);
		let rb = ImBCBase.basename(b.url);
		if (ra < rb) return -1;
		else if (ra === rb) return 0;
		else return 1;
	});
    this.stepmode = 0;
    const copytext = document.getElementById('copytext');
    const copycheck = document.getElementById('copycheck');
	this.copyright = '';
	if (copycheck !== null && copycheck.checked && copytext !== null && copytext.value !== '') this.copyright = copytext.value;
	this.totnum = selecteds.length;
	this.stats = { total: this.totnum, skipped: 0, error: 0, ok: 0 };
	this.actnum = 0;
	this.allfiles = selecteds;
	if (this.totnum > 0) {
		this.mappx(true, 'process.frombrowsern', this.totnum);
		document.getElementById('imbdoit').disabled = true;
		document.getElementById('imbvisbrows').disabled = true;
		document.getElementById('droptarget').style['display'] = 'none';
		document.getElementById('infile').disabled = true
		this.#rotphase = 1;
		this.fromvisbrows = true;
		document.getElementById('dlprogress').style['display'] = '';
		document.getElementById('browser').style['display'] = 'none';
		this.#startloadimg();
		this.topreccheck(false);
	} else {
		this.shownormal();
	}
}

/* ImBCHtml: async iterate rec */
iterate(iterator, cb, already) {
	iterator.next().then((o) => {
		//console.log('OOO ' + JSON.stringify(o));
		if (o.done)
			cb(already);
		else {
			let rr = o.value[1];
			if (rr.kind === 'directory') {
				let ai = o.value[1].entries();
				this.iterate(ai, () => {
					//console.log('xyz ' + already);
					this.iterate(iterator, cb, already);
				}, already);
			} else {
				o.value[1].getFile().then((f) => {
					already.push(f);
					this.iterate(iterator, cb, already);
				});
			}
		}
	}).catch((e) => {
		console.log('exception in iterator ' + JSON.stringify(e));
		cb(already);
	});
}
/* ImBCHtml: traverse dropped directory/s */
dirtraverse(items, cb, index = 0, already = []) {
	if (!cb) {
		return  new Promise((resolve, reject) => {
			this.dirtraverse(items, resolve, index, already);
		});
	}
    if (index >= items.length)
    	return cb(already);
    let en = items[index];
    if (en.isFile) { // not-getAsFileSystemHandle case
    	en.file((f) => {
    		already.push(f);
    		this.dirtraverse(items, cb, index + 1, already);
    	});
    }
	else if (en.kind === 'directory') {
		let ai = en.entries();
		this.iterate(ai, () => {
			//console.log('abc ' + already);
			this.dirtraverse(items, cb, index + 1, already);
		}, already);
	} else if (en.isDirectory) { // not-getAsFileSystemHandle case
		let dr = en.createReader();
		let getEntries = () => {
			dr.readEntries((results) => {
				if (results.length) {
					let r = results;
					for (let j = 0; j < r.length; j++) {
						// also files (non-dir) are pushed and the resolved a few lines above here async
						items.push(r[j]);
					}
					getEntries();
				}
				else {
					this.dirtraverse(items, cb, index + 1, already);
				}
			},
			(error) => {
				console.log(JSON.stringify(error));
			});
		};
		getEntries();
	} else {
		console.log('kind == file in dirtraverse');
		en.getFile().then((f) => {
			already.push(f);
			this.dirtraverse(items, cb, index + 1, already);
		});
	}
}
/* ImBCHtml: browserdisplay: handler function for dropping OS files into the rect */
async drophandler(ev) {
	if (this.actnum !== this.allfiles.length) return;
	this.checkchecks();
	ev.preventDefault();
	this.allfiles = [];
	let auxfiles = [];
	this.actnum = 0;
	if (ev.dataTransfer.items) {
		let mm = [...ev.dataTransfer.items];
		let m0 = mm.map(e => e.webkitGetAsEntry());
		let mapped = [];
		if (-1 !== m0.findIndex(e => e.isDirectory)) {
			for (let i =0; i < m0.length; i++) {
				if (!m0[i].isDirectory)
					auxfiles.push(mm[i].getAsFile());
			}
			for (let i =0; i < m0.length; i++) {
				if (m0[i].isDirectory) {
					if (mm[i].getAsFileSystemHandle) {
						// chromium needs it this way
						let m = await mm[i].getAsFileSystemHandle();
						mapped.push(m);
					} else {
						this.noGetFsH = true;

// orientation: 1: norm, 3: rot 180, 6 rot 90 CW, 8: rot 270 CCW
buildpreview(f, onok, onerr, orientation, targ, afterload) {
	let w, h, typ;
	if (undefined === f.size) {
		window.setTimeout(() => {
		  if (this.previewworker) {
		  	  let cachehit;
		  	  if ((cachehit = this.findcache(f.url ? f.url :f))) {
		  	  	  this.workerstate.push({ cmd: 'previewfromcache', c: cachehit, n: (f.url ? f.url :f), o: orientation, onok: onok, onerr: onerr, t: targ });
		  	  	  this.previewworker.postMessage({ cmd: 'previewfromcache', c: { n: cachehit.url, d: cachehit.d, l: cachehit.l} , n: (f.url ? f.url :f), o: orientation });
		  	  	  // onmessage: { pix: array, c: cache, n: name, o: orientation }
		  	  	  // ctx.putImageData(new ImageData(outpix, transpose ? h8: w8, transpose? w8 :h8), 0, 0); onok(f)
		  	  } else {
		  	  	  this.workerstate.push({ cmd: 'resolveandpreview', c: cachehit, n: (f.url ? f.url :f), o: orientation, onok: onok, onerr: onerr, t: targ, afterload: afterload });
		  	  	  this.previewworker.postMessage({ cmd: 'resolveandpreview', n: (f.url ? f.url :f), o: orientation });
		  	  	  // onmessage: { pix: array, n: name, o: orientation, c: cacheentry }
		  	  	  // ctx.putImageData(new ImageData(outpix, transpose ? h8: w8, transpose? w8 :h8), 0, 0); onok(f); add cache
		  	  }
		  } else {
			  this.resolver(f, true, (url, fx) => {
					this.buildpreview(fx, onok, onerr, orientation, targ, afterload);
				}, (/*url*/) => {
					onerr(f);
			  });
		  }
		}, 10);
		return;
	}
	const zz = ImBCBase.infos.findIndex(v => v.size === f.size);
	if (zz === -1) {
		console.log('preview: unsupported size ' + f.size + ' of ' + f.name);
		onerr(f);
		return;
	}
	w = ImBCBase.infos[zz].w;
	typ = ImBCBase.infos[zz].typ;
	h = ImBCBase.infos[zz].h;

	let canv;
	if (undefined !== targ)
		canv = targ;
	else
		canv = document.getElementById('preview');
	const w8 = Math.floor((w+7)/8);
	const h8 = Math.floor((h+7)/8);
	canv.width = w8;
	canv.height = h8;
	if (orientation === 6 || orientation === 8) {
		canv.width = h8;
		canv.height = w8;
	}
	const ctx = canv.getContext('2d', { alpha: false });
	if (undefined !== targ) {
		const sc = 163 / canv.width;
		//canv.style['height'] = '' + (sc*canv.height) + 'px';
	}
	const reader = f.imbackextension ? f : new FileReader();
	reader.onload = (evt) => {
		if (undefined !== afterload) afterload();
		const contents = evt.target.result;
		const view = new DataView(contents);
		const wb = this.constwb ? [ 6, 10, 1, 1, 6, 10 ] : ImBCBase.getwb(view, zz);
		let transpose = false;
		console.log(JSON.stringify(wb));
		let outpix = ImBCBase.buildpvarray(view, typ, w, h, orientation, false, wb);
        if (orientation === 6 || orientation === 8) {
                transpose = true;
        }
		ctx.putImageData(new ImageData(outpix, transpose ? h8: w8, transpose? w8 :h8), 0, 0);
		onok(f);
	};
	reader.onerror = (/*evt*/) => {
		console.log('preview: error reading ' + f.name);
		onerr();
	};
	reader.readAsArrayBuffer(f);
}

/* ImBCHtml: command handler */
custcmd(cmd, type, restargs, cb) {
	let thecmd = cmd, therest = restargs;
	if (cmd instanceof Array) {
		thecmd = cmd[0][0];
		therest = cmd[0][1];
		cmd.splice(0,1);
	}
	const xhr = new XMLHttpRequest();
	xhr.onloadend = (/*event*/) => {
		if (xhr.status === 200) {
			if (type === 'document') {
				const st = xhr.responseXML.querySelector('Function Status');
				const st2 = xhr.responseXML.querySelector('LIST ALLFile File NAME');
				if ('0' === st?.textContent || st2) {
					if (cmd instanceof Array && cmd.length > 0)
						this.custcmd(cmd, type, restargs, cb);
					else
						cb(0, xhr.response);
				}
				else
					cb(-3);
			}
			else if (cmd instanceof Array && cmd.length > 0)
				this.custcmd(cmd, type, restargs, cb);
			else
				cb(0, xhr.response);
		}
		else cb(-1);
	};
	xhr.onerror = (/*event*/) => {
		cb(-2);
	};
	if (this.imbweb.startsWith('http://127.0.0'))
		xhr.open('GET', '/i' + thecmd + '.xml');
	else
		xhr.open('GET', '/?custom=1&cmd=' + thecmd + (therest ? ('&'  + therest): ''));
	xhr.responseType = type;
	xhr.send();
}

/* ImBCHtml: find in cache */
findcache(url) {
	let e;
	if (url.url) {
		e = url;
		url = ImBCBase.basename(e.url);
	}
	else url = ImBCBase.basename(url);
	let fx = {
		imbackextension: true,
		name: url
	};
	const ii = this.#cache.findIndex((v) => (v.url === url));
	if (ii !== -1) {
		if (undefined === this.#cache[ii].reader) {
			fx.data = this.#cache[ii].d;
			fx.size = this.#cache[ii].l;
			fx.readAsArrayBuffer = (fy) => {
				fy.onload({
					target: {
						result: fy.data				}
				});
			};
			return { url: url, reader: fx, d: this.#cache[ii].d, l: this.#cache[ii].l };
		} else return { url: url, reader: this.#cache[ii].reader, d: this.#cache[ii].d, l: this.#cache[ii].l  };
	}
	return undefined;
}
/* ImBCHtml: add to cache */
addcache(name, entry) {
	this.#cache.push({ url: ImBCBase.basename(name), d: entry.data, l: entry.len, reader: entry.reader });
	if (this.#cache.length > this.#maxcache) this.#cache.splice(0,1);
}
/* ImBCHtml: file/filereader like interface for imback http */
// url can also be an imbele member
resolver(url, preview, onok, onerr, notfirst) {
	let rot, e = url;
	if (url.url) {
		e = url;
		url = e.url;
		rot = e.rot;
	}
	let fx = {
		imbackextension: true,
		name: url
	};
	const ii = this.#cache.findIndex((v) => (v.url === url));
	if (ii !== -1) {
		fx.data = this.#cache[ii].d;
		fx.size = this.#cache[ii].l;
		fx.readAsArrayBuffer = (fy) => {
			fy.onload({
				target: {
					result: fy.data				}
			});
		};
		window.setTimeout(() => {
			onok(url, fx, rot);
		}, 10);
		return;
	}
	let xhr = new XMLHttpRequest();
	xhr.onload = (/*evt*/) => {
		let len = JSON.parse(xhr.getResponseHeader('content-length'));
		if (0 >= len) len=1;
		if (notfirst && (url.substring(url.length -4).toUpperCase() === '.RAW') && len > 10000) {
			this.#cache.push({ url: url, d: xhr.response, l: len });
			if (this.#cache.length > this.#maxcache) this.#cache.splice(0,1);
		}
		fx.data = xhr.response;
		fx.size = xhr.response.byteLength;
		fx.readAsArrayBuffer = (fy) => {
			fy.onload({
				target: {
					result: fy.data				}
			});
		};
		xhr.onerror = undefined;
		xhr.ontimeout = undefined;
		xhr.onabort = undefined;
		if (notfirst) {
			window.setTimeout(() => {
				onok(url, fx, rot);
			}, 10);
		} else this.resolver(e, preview, onok, onerr, len);
	};
	xhr.onerror = (evt, typ) => {
		if (undefined === typ) typ = 'err';
		console.log('XHR err (createfx, ' + typ + ') for ' + url + ' readyState:' + xhr.readyState + ' http status:' + xhr.status + ' text: ' + xhr.statusText);
		xhr.onerror = undefined;
		xhr.onload = undefined;
		xhr.ontimeout = undefined;
		xhr.onabort = undefined;
		setTimeout(() => {
			onerr(url, fx, rot);
		}, 10);
	};
	xhr.onabort = (evt) => { xhr.onerror(evt, 'abort'); };
	xhr.ontimeout = (evt) => { xhr.onerror(evt, 'timeout'); };
	if (notfirst && preview && (url.substring(url.length -4).toUpperCase() !== '.RAW')) {
		xhr.open('GET', ImBCHtml.adjurl(url) +'?custom=1&cmd=4001');
	} else
		xhr.open(notfirst ? 'GET' : 'HEAD', ImBCHtml.adjurl(url));
	xhr.setRequestHeader('Cache-control','max-stale');
	xhr.responseType = 'arraybuffer';
	xhr.timeout = (!notfirst || notfirst < 10000000) ? 30000 : Math.round(notfirst / 600);
	try {
		xhr.send();
	} catch (e) {
		console.log('XHR send exception (createfx) for ' + url + ' ' + e.toString());
		xhr.onerror = undefined;
		xhr.onload = undefined;
		xhr.ontimeout = undefined;
		xhr.onabort = undefined;
		window.setTimeout(() => {
			onerr(url, fx, rot);
		}, 10);
	}
}
/* ImBCHtml: worker on message */
workermsg(msg) {
	const d = msg.data;
	//console.log('from worker ' + JSON.stringify(d));
	switch (d.cmd) {
	case 'resolveandhandle':
		// onmessage: { ok?, n: f.name, o: orientation, fl: fromloop, c: cacheentry }
		if (d.ok) {
			let fx = {
				imbackextension: true,
				name: d.n
			};
			fx.data = d.c.data;
			fx.size = d.c.len;
			fx.readAsArrayBuffer = (fy) => {
				fy.onload({
					target: {
						result: fy.data				}
				});
			};
			this.allfiles[this.actnum] = fx;
			d.c.reader = fx;
			this.addcache(d.n, d.c);
			this.handleone(d.o, d.fl);
		} else {
			this.mappx(false, 'words.sorryerr');
			this.mappx(true, 'process.erraccess', d.n);
			this.stats.error ++;
			if (undefined !== this.exitcode) this.exitcode++;
			this.handlenext(d.fl);
		}
		break;
	case 'resolveandpreview':
		// onmessage: { pix: array, n: name, o: orientation, t: targ, onok, onerr, c: cacheentry }
		if (d.pix) this.addcache(d.n, d.c);
		// no break
	case 'previewfromcache':
		// onmessage: { pix: array, c: cache, n: name, o: orientation, t: targ, onok, onerr }
		let w0 = this.workerstate[0];
		this.workerstate.splice(0,1);
		if (d.pix) {
			const f = this.findcache(d.n).reader;
			const zz = ImBCBase.infos.findIndex(v => v.size === f.size);
			if (zz === -1) {
				console.log('preview: unsupported size ' + f.size + ' of ' + f.name);
				w0.onerr(f);
				return;
			}
			let w = ImBCBase.infos[zz].w;
			let typ = ImBCBase.infos[zz].typ;
			let h = ImBCBase.infos[zz].h;
		
			let canv;
			if (undefined !== w0.t)
				canv = w0.t;
			else
				canv = document.getElementById('preview');
			const w8 = Math.floor((w+7)/8);
			const h8 = Math.floor((h+7)/8);
			canv.width = w8;
			canv.height = h8;
			if (d.o === 6 || d.o === 8) {
				canv.width = h8;
				canv.height = w8;
			}
			const ctx = canv.getContext('2d', { alpha: false });
			if (undefined !== w0.t) {
				const sc = 163 / canv.width;
				//canv.style['height'] = '' + (sc*canv.height) + 'px';
			}
			let transpose = false;
			const outpix = d.pix;
			if (d.o === 6 || d.o === 8) {
					transpose = true;
			}
			ctx.putImageData(new ImageData(outpix, transpose ? h8: w8, transpose? w8 :h8), 0, 0);
			w0.onok(f);
		} else {
			w0.onerr(d.n);
		}
		break;
	case 'afterload':
		if (undefined !== this.workerstate[0].afterload) this.workerstate[0].afterload();
		break;
	}
}

<script type="text/js-previewworker" language="javascript">
/* *************************************** Main class for WORKER *************************************** */
let cmd, name, cache, ori, fl, base, msg = false;
onmessage = (e) => {
	//console.log(JSON.stringify(e.data));
	name = e.data.n;
	cmd = e.data.cmd;
	ori = e.data.o;
	fl = e.data.fl;
	cache = {};
	if (!msg) {
		console.log('WORKER SEEMS OK');
		msg = true;
	}
	switch (cmd) {
	case 'seturl':
		base = e.data.url;
		break;
	case 'resolveandpreview':
		resolver(name, true);
		// this.previewworker.postMessage({ cmd: 'resolveandpreview', n: (f.url ? f.url :f), o: orientation });
 	  	// onmessage: { pix: array, n: name, o: orientation, c: cacheentry }
		break;
	case 'previewfromcache':
		buildpreviewcache(e.data.c, e.data.o);
		// this.previewworker.postMessage({ cmd: 'previewfromcache', c: cachehit, n: (f.url ? f.url :f), o: orientation });
		// onmessage: { pix: array, c: cache, n: name, o: orientation }
		break;
	case 'resolveandhandle':
		resolver(name, false);
		//this.previewworker.postMessage({ cmd: 'resolveandhandle', n: (f.name ? f.name : f), o: orientation, fl: fromloop });
		// onmessage: { ok?, n: f.name, o: orientation, fl: fromloop, c: cacheentry }
	}
};
/* WORKER: handle communication */
resolver = (url, preview, notfirst) => {
	let rot, e = url;
	if (url.url) {
		e = url;
		url = e.url;
		rot = e.rot;
	}
	let fx = {
		imbackextension: true,
		name: url
	};
	let xhr = new XMLHttpRequest();
	xhr.onload = (/*evt*/) => {
		let len = JSON.parse(xhr.getResponseHeader('content-length'));
		if (0 >= len) len=1;
		cache.data = xhr.response;
		cache.len = xhr.response.byteLength;
		fx.data = xhr.response;
		fx.size = xhr.response.byteLength;
		fx.readAsArrayBuffer = (fy) => {
			fy.onload({
				target: {
					result: fy.data				}
			});
		};
		xhr.onerror = undefined;
		xhr.ontimeout = undefined;
		xhr.onabort = undefined;
		if (notfirst) {
			if (!preview) {
				//console.log('POSTING ' + url);
				postMessage({ cmd: cmd, ok: true, n: url, o: ori, fl: fl, c: cache });
			}
			else {
				buildpreview(fx, ori);
			}
		} else resolver(e, preview, len);
	};
	xhr.onerror = (evt, typ) => {
		if (undefined === typ) typ = 'err';
		console.log('WORKER XHR err (createfx, ' + typ + ') for ' + url + ' readyState:' + xhr.readyState + ' http status:' + xhr.status + ' text: ' + xhr.statusText);
		xhr.onerror = undefined;
		xhr.onload = undefined;
		xhr.ontimeout = undefined;
		xhr.onabort = undefined;
		postMessage({ cmd: cmd, ok: false, n: name });
	};
	xhr.onabort = (evt) => { xhr.onerror(evt, 'abort'); };
	xhr.ontimeout = (evt) => { xhr.onerror(evt, 'timeout'); };
	if (notfirst && preview && (url.substring(url.length -4).toUpperCase() !== '.RAW')) {
		xhr.open('GET', base + adjurl(url) +'?custom=1&cmd=4001');
	} else {
		//fetch(base + adjurl(url), { mode: 'no-cors' }).then((rs) => {
		//		console.log('RRR ' + url + ' ' + JSON.stringify(rs.url));
		//});
		xhr.open(notfirst ? 'GET' : 'HEAD', base + adjurl(url));
	}
	xhr.setRequestHeader('Cache-control','max-stale');
	xhr.responseType = 'arraybuffer';
	xhr.timeout = (!notfirst || notfirst < 10000000) ? 30000 : Math.round(notfirst / 600);
	try {
		xhr.send();
	} catch (e) {
		console.log('WORKER XHR send exception (createfx) for ' + url + ' ' + e.toString());
		xhr.onerror = undefined;
		xhr.onload = undefined;
		xhr.ontimeout = undefined;
		xhr.onabort = undefined;
		postMessage({ cmd: cmd, ok: false, n: name });
	}
}
/* WORKER: build preview in array */
buildpvarray = (view, typ, w, h, orientation, scale, wb) => {
	if (undefined === wb) wb = [ 6, 10, 1, 1, 6, 10 ];
	const sfact = scale ? scale : 8;
	const w8 = Math.floor((w+(sfact -1))/sfact);
	const h8 = Math.floor((h+(sfact -1))/sfact);
	const rfact = (wb[1]/wb[0]);
	const gfact = (wb[3]/wb[2]);
	const bfact = (wb[5]/wb[4]);
	let outpix = [];
	let rowiterstart, rowiterend;
	let coliterstart, coliterend;
	let transpose = false;
	if (orientation === 3) {
		rowiterstart = -1*(h8 -1);
		rowiterend = 1;
		coliterstart = -1*(w8 - 1);
		coliterend = 1;
	} else if (orientation === 6) {
		transpose = true;
		rowiterstart = 0;
		rowiterend = w8;
		coliterstart = -1*(h8 - 1);
		coliterend = 1;
	} else if (orientation === 8) {
		transpose = true;
		rowiterstart = -1*(w8 -1);
		rowiterend = 1;
		coliterstart = 0;
		coliterend = h8;
	} else {
		rowiterstart = 0;
		rowiterend = h8;
		coliterstart = 0;
		coliterend = w8;
	}
	let hist = new Array(256);
	for (let i = 0; i < 256; i++) hist[i] = 0;
	let cnt = 0;
	for (let i = rowiterstart; i < rowiterend; i +=1) {
		for (let j = coliterstart; j < coliterend; j+=1) {
			let a = getPix(Math.abs(transpose ? i :j)*sfact, Math.abs(transpose ? j :i)*sfact, w, view, typ);
			outpix.push(a[0]);
			outpix.push(a[1]);
			outpix.push(a[2]);
			const v = Math.ceil((rfact*a[0] + gfact*a[1] + bfact*a[2])/3);
			if (v >= 255) hist[255]++;
			else hist[v]++;
			cnt++;
		}
	}
	// cut off top and bottom 7%
	let cntx = 0, allmin = 0, allmax = 255;
	while (cntx < (cnt * 0.07))
		cntx += hist[allmin++];
	allmin --;
	cntx = 0;
	while (cntx < (cnt * 0.07))
		cntx += hist[allmax--];
	allmax++;
	let fact;
	if (allmax > 247 && allmin < 8) fact = 1;
	/*else if (allmax - allmin < 33) {
		const d = ((255-33-allmin)/2)
		if (allmin < 255-33) {
			allmin += d;
			allmax += d;
		}
		fact = 8;
	}*/
	else fact = 240/(allmax - allmin);
	//console.log('ai ' + allmin + ' aa ' + allmax + ' ff ' + fact);
	const o = scale ? 3 : 4;
	const uic = new Uint8ClampedArray(h8 * w8 * o);
	for (let i = 0; i < h8; i++) {
		for (let j=0; j< w8; j++) {
			let nr = ((outpix[3*((i * w8) + j)] * rfact) - allmin) * fact + allmin;
			let ng = ((outpix[3*((i * w8) + j) + 1] * gfact) - allmin) * fact + allmin;
			let nb = ((outpix[3*((i * w8) + j) + 2] * bfact) - allmin) * fact + allmin;
			if (nr >= 255) {
				if (ng < 250) ng = Math.round(ng * 255 / nr);
				if (nb < 250) nb = Math.round(nb * 255 / nr);
				nr = 255;
			}
			else if (nr <= 0) nr = 0;
			if (ng >= 255) {
				if (nr < 250) nr = Math.round(nr * 255 / ng);
				if (nr >= 255) nr = 255;
				if (nb < 250) nb = Math.round(nb * 255 / ng);
				ng = 255;
			}
			else if (ng <= 0) ng = 0;
			if (nb >= 255) {
				if (ng < 250) ng = Math.round(ng * 255 / nb);
				if (ng >= 255) ng = 255;
				if (nr < 250) nr = Math.round(nr * 255 / nb);
				if (nr >= 255) nr = 255;
				nb = 255;
			}
			else if (nb <= 0) nb = 0;
			// maybe some brightening gamma?
			uic[o * ((i*w8) + j)] = 255-Math.round(255*((255-nr)/255)*((255-nr)/255));
			uic[o * ((i*w8) + j) + 1] = 255-Math.round(255*((255-ng)/255)*((255-ng)/255));
			uic[o * ((i*w8) + j) + 2] = 255-Math.round(255*((255-nb)/255)*((255-nb)/255));
			if (!scale) uic[o * ((i*w8) + j) + 3] = 255;
		}
	}
	return uic;
}
/* WORKER: browserdisplay: build preview */
// orientation: 1: norm, 3: rot 180, 6 rot 90 CW, 8: rot 270 CCW
buildpreview = (f, orientation) => {
	let w, h, typ;
	const zz = infos.findIndex(v => v.size === f.size);
	if (zz === -1) {
		console.log('WORKER preview: unsupported size ' + f.size + ' of ' + f.name);
		postMessage({ cmd: cmd, ok: false, n: name });
		return;
	}
	w = infos[zz].w;
	typ = infos[zz].typ;
	h = infos[zz].h;

	const w8 = Math.floor((w+7)/8);
	const h8 = Math.floor((h+7)/8);
	const reader = f.imbackextension ? f : new FileReader();
	reader.onload = (evt) => {
		const contents = evt.target.result;
		const view = new DataView(contents);
		const wb = this.constwb ? [ 6, 10, 1, 1, 6, 10 ] : getwb(view, zz);
		let transpose = false;
		console.log(JSON.stringify(wb));
		let outpix = buildpvarray(view, typ, w, h, orientation, false, wb);
		// onmessage: { pix: array, n: name, o: orientation, c: cacheentry }
		postMessage({ cmd: cmd, pix: outpix, n: name, o: ori, c: cache });
	};
	reader.onerror = (/*evt*/) => {
		console.log('WORKER preview: error reading ' + f.name);
		postMessage({ cmd: cmd, ok: false, n: name });
	};
	reader.readAsArrayBuffer(f);
}
/* WORKER: browserdisplay: build preview from cache */
// orientation: 1: norm, 3: rot 180, 6 rot 90 CW, 8: rot 270 CCW
buildpreviewcache = (f, orientation) => {
	let w, h, typ;
	const zz = infos.findIndex(v => v.size === f.l);
	if (zz === -1) {
		console.log('WORKER preview: unsupported size ' + f.l + ' of ' + f.n);
		postMessage({ cmd: cmd, ok: false, n: name });
		return;
	}
	w = infos[zz].w;
	typ = infos[zz].typ;
	h = infos[zz].h;

	const w8 = Math.floor((w+7)/8);
	const h8 = Math.floor((h+7)/8);
	const contents = f.d;
	const view = new DataView(contents);
	const wb = this.constwb ? [ 6, 10, 1, 1, 6, 10 ] : getwb(view, zz);
	let transpose = false;
	console.log(JSON.stringify(wb));
	let outpix = buildpvarray(view, typ, w, h, orientation, false, wb);
	// onmessage: { pix: array, n: name, o: orientation, c: cacheentry }
	postMessage({ cmd: cmd, pix: outpix, n: name, o: ori, c: cache });
}
/* WORKER: get white balance */
getwb = (view, typidx) => {
	//console.log('GWB ' + typidx + ' ' + JSON.stringify(ImBCBase.infos[typidx]));
	const t = infos[typidx];
	let r=1, g=1, b=1;
	for (let i=Math.round(0.05*t.h)*2; i<Math.ceil(0.9*t.h); i+=8) {
		for (let j=Math.round(0.05*t.w)*2; j<Math.ceil(0.9*t.w); j+=8) {
			let x = getPix(j, i, t.w, view, t.typ);
			let lr = x[0];
			let lg = x[1] + 1;
			let lb = x[2];
			let p = Math.sqrt(lg*lg + lb*lb + lr*lr);
			if (p < 3 || p > (3*250)) continue;
			//if (((i*t.w + j) % 50000) < 10)
			//	console.log('i ' + i + ' j ' + j + ' R ' + lr + ' G ' + lg + ' B ' + lb + ' P ' + p);
			b += (lb)/(p);
			g += (lg)/(p);
			r += (lr)/(p);
		}
	}
	if ((r > b) && (r > g)) {
		return [ 10, 10, Math.ceil(300000*g/r), 300000, Math.ceil(300000*b/r), 300000 ];
	}
	else if ((b > r) && (b > g)) {
		return [ Math.ceil(300000*r/b), 300000, Math.ceil(300000*g/b), 300000, 10, 10 ];
	}
	else {
		return [ Math.ceil(300000*r/g), 300000, 10, 10, Math.ceil(300000*b/g), 300000 ];
	}
}
/* WORKER: get one downsampled median image value [ r g b ] */
getPix = (x, y, w, view, typ) => {
	let outrgb = [];
	let reds = [];
	let w3 = w + (w>>1);
	let xx = x + (x>>1);
	if (typ === 5) {
		reds.push(((view.getUint8((y+0)*w3 + xx+0) +  ((view.getUint8((y+0)*w3 + xx+1) &0xF) << 8))-240)/16);
		reds.push(((view.getUint8((y+0)*w3 + xx+3) +  ((view.getUint8((y+0)*w3 + xx+4) &0xF) << 8))-240)/16);
		reds.push(((view.getUint8((y+2)*w3 + xx+0) +  ((view.getUint8((y+2)*w3 + xx+1) &0xF) << 8))-240)/16);
		reds.push(((view.getUint8((y+2)*w3 + xx+3) +  ((view.getUint8((y+2)*w3 + xx+4) &0xF) << 8))-240)/16);
	}
	else if (typ > 1) {
		reds.push(view.getUint8((y+1)*w + x + 1));
		reds.push(view.getUint8((y+1)*w + x + 3));
		reds.push(view.getUint8((y+1)*w + x + 2*w + 1));
		reds.push(view.getUint8((y+1)*w + x + 2*w + 3));
	} else {
		reds.push(view.getUint8(y*w + x + 1));
		reds.push(view.getUint8(y*w + x + 3));
		reds.push(view.getUint8(y*w + x + 2*w + 1));
		reds.push(view.getUint8(y*w + x + 2*w + 3));
	}
	reds.sort(function(a,b) { return a - b; });
	// median of red pixels
	outrgb.push((reds[1] + reds[2]) / 2.0);
	let greens = [];
	if (typ === 5) {
		greens.push((((view.getUint8((y+0)*w3 + xx+2)<<4) +  ((view.getUint8((y+0)*w3 + xx+1) &0xF0) >> 4))-240)/16);
		greens.push(((view.getUint8((y+1)*w3 + xx+0) +  ((view.getUint8((y+1)*w3 + xx+1) &0xF) << 8))-240)/16);
		greens.push((((view.getUint8((y+0)*w3 + xx+5)<<4) +  ((view.getUint8((y+0)*w3 + xx+4) &0xF0) >> 4))-240)/16);
		greens.push(((view.getUint8((y+1)*w3 + xx+3) +  ((view.getUint8((y+1)*w3 + xx+4) &0xF) << 8))-240)/16);
		greens.push((((view.getUint8((y+2)*w3 + xx+2)<<4) +  ((view.getUint8((y+2)*w3 + xx+1) &0xF0) >> 4))-240)/16);
		greens.push(((view.getUint8((y+3)*w3 + xx+0) +  ((view.getUint8((y+3)*w3 + xx+1) &0xF) << 8))-240)/16);
		greens.push((((view.getUint8((y+2)*w3 + xx+5)<<4) +  ((view.getUint8((y+2)*w3 + xx+4) &0xF0) >> 4))-240)/16);
		greens.push(((view.getUint8((y+3)*w3 + xx+3) +  ((view.getUint8((y+3)*w3 + xx+4) &0xF) << 8))-240)/16);
	}
	else if (typ > 1) {
		greens.push(view.getUint8(y*w + x + 1));
		greens.push(view.getUint8(y*w + x + w));
		greens.push(view.getUint8(y*w + x + 3));
		greens.push(view.getUint8(y*w + x + 2 + w));
		greens.push(view.getUint8(y*w + x + 2*w + 1));
		greens.push(view.getUint8(y*w + x + 3*w));
		greens.push(view.getUint8(y*w + x + 2*w + 3));
		greens.push(view.getUint8(y*w + x + 3*w + 2));
	} else {
		greens.push(view.getUint8(y*w + x));
		greens.push(view.getUint8(y*w + x + w + 1));
		greens.push(view.getUint8(y*w + x + 2));
		greens.push(view.getUint8(y*w + x + 3 + w));
		greens.push(view.getUint8(y*w + x + 2*w));
		greens.push(view.getUint8(y*w + x + 3*w +1));
		greens.push(view.getUint8(y*w + x + 2*w + 2));
		greens.push(view.getUint8(y*w + x + 3*w + 3));
	}
	greens.sort(function(a,b) { return a - b; });
	outrgb.push((greens[3] + greens[4]) / 2.0);
	let blues = [];
	if (typ == 5) {
		blues.push((((view.getUint8((y+1)*w3 + xx+2)<<4) +  ((view.getUint8((y+1)*w3 + xx+1) &0xF0) >> 4))-240)/16);
		blues.push((((view.getUint8((y+1)*w3 + xx+5)<<4) +  ((view.getUint8((y+1)*w3 + xx+4) &0xF0) >> 4))-240)/16);
		blues.push((((view.getUint8((y+3)*w3 + xx+2)<<4) +  ((view.getUint8((y+3)*w3 + xx+1) &0xF0) >> 4))-240)/16);
		blues.push((((view.getUint8((y+3)*w3 + xx+5)<<4) +  ((view.getUint8((y+3)*w3 + xx+4) &0xF0) >> 4))-240)/16);
	}
	else if (typ > 1) {
		blues.push(view.getUint8(y*w + x));
		blues.push(view.getUint8(y*w + x + 2));
		blues.push(view.getUint8(y*w + x + 2*w));
		blues.push(view.getUint8(y*w + x + 2*w + 2));
	} else {
		blues.push(view.getUint8((y+1)*w + x));
		blues.push(view.getUint8((y+1)*w + x + 2));
		blues.push(view.getUint8((y+1)*w + x + 2*w));
		blues.push(view.getUint8((y+1)*w + x + 2*w + 2));
	}
	blues.sort(function(a,b) { return a - b; });
	outrgb.push((blues[1] + blues[2]) / 2.0);
	return outrgb;
}
/* WORKER: adjust A:\imback\... format to /imback/... */
adjurl = (url) => {
	if (url.url) url = url.url;
	if (url.toUpperCase().substring(0,3) !== 'A:\\')

}
